//将字符串分割为字串，再看每部分符合回文串的定义与否即可。这道题就可以拆分为这么两部分
//第二部分简单，只需要用前后双指针判断是否相等即可（在charAt方法里修改指针更简洁）
//第一部分就需要使用回溯的思想了，枚举最后一个字串的位置，判断每次是否是回文串。


class Solution {
    public List<List<String>> partition(String s) {
        List <String> path = new ArrayList<>();
        List<List <String>> ans = new ArrayList<>();
        dfs(ans, path, s, 0);
        return ans;

    }

    private void dfs(List<List <String>> ans, List <String> path, String s, int i ){
        if(i == s.length()){
            ans.add(new ArrayList<>(path));
            return;
        }

        for(int j = i; j < s.length(); j++){
            if(isPalinddrome(i, j, s)){
                path.add(s.substring(i, j + 1));//subString返回新的字符串，左闭右开，substring是一个单词，所以都是小写
                dfs(ans, path, s, j + 1);
                path.removeLast();//恢复现场
            }
        }
    }

    private boolean isPalinddrome(int start, int end, String s){
        while(start < end){
            if(s.charAt(start++) != s.charAt(end--)){
                // start++;
                // end--;  这么写估计在if外面还得写start和end的++和--，没有直接写在charAt方法里简洁
                return false;
            }
        }
        return true;
    }
}

